import './DoctorLogin.css';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function DoctorLogin() {
    const[signUp, setSignUp] = useState(false);
    const[signIn, setSignIn] = useState(false);
    const navigate = useNavigate();

    const handleClick = (input) => {
        if (input === "sign up") {
            setSignUp(true);
        } else if (input === "sign in") {
            setSignIn(true);
        }
    }
    return (
        <div>
            <h1>Doctor</h1>
            {!signIn && !signUp ? (
                <div className='account-container'>
                    <button className="account-button" onClick={() => handleClick("sign in")}>Sign In</button>
                    <button className="account-button" onClick={() => handleClick("sign up")}>Create An Account</button>
                </div>
            ): null}

            {signIn ? (
                <div>
                    <h2>Sign In</h2>
                    <form>
                        <label>Username:</label>
                            <input type="text"/>
                        <label>Password:</label>
                            <input type="password"/>
                        <button type="submit">Log in</button>
                    </form>
                    <button onClick={() => setSignIn(false)}>Back</button>
                </div>
            ) : null}

{signIn ? (
                <div>
                    <h2>Sign In</h2>
                    <form>
                        <label>Username:</label>
                            <input type="text"/>
                        <label>Password:</label>
                            <input type="password"/>
                        <button type="submit">Log in</button>
                    </form>
                    <button onClick={() => setSignIn(false)}>Back</button>
                </div>
            ) : null}



        </div>
    )
}
